import Gallery from "react-grid-gallery";
import React from "react";

export function HomeGallery(props) {
    return (
        <div style={{
            display: "block",
            minHeight: "1px",
            width: "100%",
            overflow: "auto",
            position: 'absolute',
            cursor: 'none'
        }}>
            <Gallery
                images={props.images}
                enableLightbox={false}
                enableImageSelection={false}/>
        </div>
    )
}
